import React, {useState, useEffect} from 'react';
import './App.css';
import Video from './Video';
import db from './firebase';


function App() {
  const [videos, setVideos] = useState([]);

  useEffect(() => {
    db.collection("videos").onSnapshot((snapshot) =>
      setVideos(snapshot.docs.map((doc) => doc.data()))
    );
  }, []);

  return (
    <div className="app">
      <center>
        <div className="app__videos">
          {/* pulled from firebase database */}
          <Video 
            url="https://v16m.tiktokcdn.com/bb3e77bada88408fa79bbdacf3546500/5f2c4a47/video/tos/useast2a/tos-useast2a-ve-0068c004/d78469eb1da54c288d558cae86374074/?a=1233&br=3898&bt=1949&cr=0&cs=0&dr=0&ds=3&er=&l=2020080418215901019021809330343FC9&lr=tiktok_m&mime_type=video_mp4&qs=0&rc=M29tNzRwZDY0dTMzZDczM0ApMzo6NjszNWRmNzk8Mzo2Z2dnL3JtX2dhaGZfLS1hMTZzc18vMDRfMDNgXzAtMTIyYTY6Yw%3D%3D&vl=&vr="
            channel="Omar"
            description=" ......."
            song="Mastooora"
            likes={123}
            messages={12121}
            shares={12121}
          />
        </div>
      </center>
    </div>
  );
}

export default App;
